import React from "react";
import Card from './Card';
import cardData from "./cardData";
const CardSection = (props) => {
    return (
        <section className="card-sec">
        <div className="container-fluid">
        <div className="jumbotron  mb-0 text-left bg-transparent ">
                <div className="container">
                    <h5>Our Team</h5>
                    <h3>Bootstrap is the most popular HTML, CSS, and JS framework for developing
                        responsive, mobile-first projects on the web.</h3>
                </div>
            </div>
        </div>
        <div className="container" id="demo2">
            {/* <div className="jumbotron  mb-0 text-center bg-dark text-light">
                <div className="container">
                    <h1>Our Team</h1>
                    <p>Bootstrap is the most popular HTML, CSS, and JS framework for developing
                        responsive, mobile-first projects on the web.</p>
                </div>
            </div> */}
            <div className="row justify-content-center">
                {cardData.map((val) => {
                    return (<Card key={val.id} name={val.name} text={val.text} imgsrc={val.imgsrc}/>)
                })}
            </div>
        </div>
        </section>
    );
}
export default CardSection;
